import React from "react";
import {
    createBrowserRouter, 
    createRoutesFromElements,
    Route, 
    NavLink,
    RouterProvider
  } from 'react-router-dom';
import Home from "./templates/Home";
import "./App.css";
import About from "./templates/About";
import Blog from "./templates/Blog";
import RootLayout from "./partials/RootLayout";
import NotFound from "./templates/NotFound";
import Login from "./templates/Login";

const router = createBrowserRouter(
    createRoutesFromElements(
        <Route path="/wordpressidex.php" element={<RootLayout />}>
        <Route path="/wordpress.index.php" index element={<Home />} />
        <Route path="/wordpress/index.php/about" element={<About />} />  
        <Route path="/wordpress/index.php/blog" element={<Blog />} />
        <Route path="/wordpress/index.php/signin" element={<Login />} />
        <Route path="/wordpress/*" element={<NotFound />} />
        </Route>
    )
  )
function App() {
    return (
        <RouterProvider router={router} />

    );
}

export default App;
